class NewJobs extends Component {
	state = {
		posts: null,
	}

	componentWillMount() {
		axios.get('https://interview-corner-1de29.firebaseio.com/new-jobs.json')
		.then(response => {
			this.setState({ posts: response.data });
			const posts = Object.values(response.data);
			// console.log(Object.values(Object.values(response.data)));
			// console.log(Object.values(response.data));
		});
	}
	render() {
	let posts = null;
	if(this.state.posts) {
		console.log(Object.keys(this.state.posts));
		let k = 0;
		let arr = Object.values(this.state.posts);

		posts = Object.values(this.state.posts).map(post => {
			return (
				<div>
				<Card type = "inner" title= { post.title } key = { k++ }>
					<p> { post.newPost } </p>
				</Card> <br/> <br/> <br/>
				</div>
			);
		});
	}
		return (
			<div>
			<br/> <br/>
			{posts}
			</div>
		);
	}
}

export default NewJobs;
